,'2021-10-05 12:20:45','2021-10-05 12:20:45',NULL),(19,'Однолетние цветы','Колокольчик Elizabeth Oliver','укорененный черенок',1.28,'EUR',83,1,'http://new.guslica.ru/kolokolchik-elizabeth-oliver','Данный сорт создает плотный ковер из крошечных листьев, быстро разрастается. Прекрасные небольшие полумахровые колокольчики появляются в начале лета. Они похожи на маленькие соцветия сирени. Растение очень легко выращивать.Подходит для альпинариев, позиции солнечные или полутень. Он хорошо работает как многолетнее почвопокровное или как бордюрное растение.','2021-10-05 12:20:45','2021-10-05 12:20:45',NULL),(20,'Однолетние цветы','Леукантемум Victorian Secret (Vtr)','укорененный черенок',1.22,'EUR',83,1,'http://new.guslica.ru/leukantemum-victorian-secret-vtr','Эта компактная разновидность производит взъерошенные белые лепестки,одиночные и махровые,окружая желтый кнопку-глаз.Непрерывно цветут в течение лета.','2021-10-05 12:20:45','2021-10-05 12:20:45',NULL),(21,'Однолетние цветы','Рудбекия SmileyZ Giggling (25)','укорененный черенок',1.50,'EUR',83,1,'http://new.guslica.ru/rudbekija-giggling-smileyz?search=%D0%A0%D1%83%D0%B4%D0%B1%D0%B5%D0%BA%D0%B8%D1%8F%20Giggling%20SmileyZ&category_id=0','Двулетнее, цветущее растение. Куст высотой до 60 см. Стебли прямостоячие украшены большими цветами ярких красных тонов. Предпочитает солнечные места и стабильный полив. Хорошо смотрится в групповых цветочных посадках. Прекрасно размножается семенами.','2021-10-05 12:20:45','2021-10-05 12:20:45',NULL),(22,'Однолетние цветы','Флокc Early Red','укорененный черенок',0.77,'EUR',83,1,'http://new.guslica.ru/flokc-early-red','Цветок яркий сиреневый. Куст компактный в ширину и высоту достигает 30см.','2021-10-05 12:20:45','2021-10-05 12:20:45',NULL),(23,'Однолетние цветы','Хаконехлоя All Gold','укорененный черенок',1.21,'EUR',83,1,'http://new.guslica.ru/hakonehloja-all-gold-vtf','Потрясающие золотые листья,которые удерживают свой цвет все лето до наступления зимы.Прямостоячие,колючие листья. Выгля